<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Rockets</title>
    <link rel="stylesheet" href="prueba.css">
</head>
<body>
    <div id="container">

        <mi-top id="topbar">
            <mi-topone id="one"></mi-one>
            <mi-toptwo id="two"></mi-two>
            <mi-topthree id="three"></mi-three>
            <mi-topfour id="four"></mi-four>
        </mi-top>

        <mi-right id="rightbar" class="no">
            <mi-rightone id="rightone"></mi-rightone>
            <mi-righttwo id="righttwo"></mi-righttwo>
            <mi-rightthree id="rightthree"></mi-rightthree>
            <mi-rightfour id="rightfour"></mi-rightfour>
        </mi-right>

        <mi-left id="leftbar" class="no"></mi-left>

        <mi-center id="centerbar"></mi-center>

        <mi-supcenter id="supcenter"></mi-supcenter>

        <mi-rightcenter id="rightcenterbar"></mi-rightcenter>

        <mi-leftcenter id="leftcenterbar"></mi-leftcenter>

        <div id="downbar">
            <img src="../storage/img/icons/rocket.svg" alt="">
            <img src="../storage/img/icons/capsule.svg" alt="">
            <img src="../storage/img/icons/history.svg" alt="">
            <img src="../storage/img/icons/company.svg" alt="">
        </div>

        <div id="buttons">
            <button id="uno">1</button>
            <button id="dos">2</button>
            <button id="tres">3</button>
            <button id="cuatro">4</button>
        </div>

    </div>
</body>
<script src="./prueba.js"></script>
</html>
